import Navbar from "./components/Navbar";
import Home from "./sections/Home";
import Services from "./sections/Services";
import Contact from "./sections/Contact";
import Footer from "./components/Footer";
// import "./theme-portfolio/orange.css"
import Skills from "./sections/Skills";
import About from "./sections/About";
import Portfolio from "./sections/Portfolio";

// Base / Reset
import './theme-portfolio/base.css';

// Sections / Layout
import './theme-portfolio/navbar.css';
import './theme-portfolio/hero.css';
import './theme-portfolio/skills.css';
import './theme-portfolio/services.css';
import './theme-portfolio/about.css';
import './theme-portfolio/contact.css';
import './theme-portfolio/footer.css';
import './theme-portfolio/portfolio.css'; // if you split portfolio separately

// Animations
import './theme-portfolio/animations.css';

// Responsive / Media Queries
import './theme-portfolio/responsive.css';

function App() {
  return (
    <>
      <Navbar />
      <Home />
      <About />
      <Skills />
      <Services />
      <Portfolio />
      <Contact />
      <Footer />
    </>
  );
}

export default App;
